import React, { Component } from "react";
import {
  Button,
  Container,
  Grid,
  AppBar,
  Toolbar,
  CardMedia,
  Input,
  Box
} from "@material-ui/core";

class Header extends Component {
  state = {
    textInput: ""
  };

  inputHandle = event => {
    if (event.target.value) {
      this.setState({ textInput: event.target.value });
    } else {
      this.setState({ textInput: "" });
    }
  };

  render() {
    return (
      <div>
        <AppBar position="static" color="primary">
          <Grid color="primary">
            <Toolbar>
              <CardMedia
                image={require("../images/6pm-Logo-1x._V285053994_.png")}
              />
              <Button onClick={() => {}} style={{ color: "white" }}>
                Home
              </Button>
              <Button style={{ color: "white" }}>Contact</Button>
              <Button style={{ color: "white" }}>About</Button>
              <Button style={{ color: "white" }}>Login</Button>

              <Button style={{ color: "white" }}>Register</Button>
            </Toolbar>
            <Box borderRadius={10} borderColor="gray" marginTop={0}>
              <Input
                onChange={this.inputHandle}
                placeholder="Search..."
                disableUnderline={true}
                style={{
                  width: 500,
                  border: "red",
                  color: "gray",
                  background: "white",
                  padding: 1 | 5 | 1 | 5,
                  borderColor: "gray",
                  borderWidth: 2,
                  borderRadius: 10
                }}
              />
            </Box>
          </Grid>
        </AppBar>
        <Container>
          <Button
            variant="contained"
            color="primary"
            onClick={() => console.log(this.state.textInput)}
          >
            Hello World
          </Button>
          <br />
        </Container>
      </div>
    );
  }
}

export default Header;
